function readMolandPDBpair(mol, pdb){
  fetch(mol).then(response => response.text()).then(function(text) {
    //info = loadQualityInformationNames(text)
    let badidsRegex = /[\n\r].*<BADATOMS>\s*([^\n\r]*)/;
    let badcommentsRegex = /[\n\r].*<BADCOMMENTS>\s*([^\n\r]*)/;
    let badnamesRegex = /[\n\r].*<BADNAMES>\s*([^\n\r]*)/;
    let badidsRegexResult = badidsRegex.exec(text);
    let badcommentsRegexResult = badcommentsRegex.exec(text);
    let badnamesRegexResult = badnamesRegex.exec(text);
    
    let badidsValue =
    badidsRegexResult != null && badidsRegexResult && badidsRegexResult.length > 1 ? badidsRegexResult[1] : '';
    let badcommentsValue =
    badcommentsRegexResult != null && badcommentsRegexResult && badcommentsRegexResult.length > 1
      ? badcommentsRegexResult[1]
      : '';
    let badnamesValue =
    badnamesRegexResult != null && badnamesRegexResult && badnamesRegexResult.length > 1 ? badnamesRegexResult[1] : '';
    let badids = badidsValue === '' ? [] : badidsValue.split(';').map(x => parseInt(x));
    let badcomments = badcommentsValue === '' ? [] : badcommentsValue.split(';');
    let badnames = badnamesValue === '' ? [] : badnamesValue.split(';');
    let goodids = readGoodAtomsFromFile(text, badids);
    let idx = [...Array(badnames.length).keys()];
    let molids = [];
    let pdbids = [];
    // If badnames length is enough
    // else do something else coordinate properly
    idx.forEach( (num) => {
      badnames[num].includes("HET") ? molids.push(num) : pdbids.push(num);
    })
    let pdbatomid = pdbids.map(i => badids[i])
    let pdbnames = pdbids.map(i => badnames[i])
    let pdbcomments = pdbids.map(i => badcomments[i])
    let molatomid = molids.map(i => badids[i])
    let molnames = molids.map(i => badnames[i])
    let molcomments = molids.map(i => badcomments[i])
    readPDBwithBadIDS(pdb, atomset={molatomid, molnames, molcomments, pdbatomid, pdbnames, pdbcomments})
    readMolwithBadIDS(mol, atomset={goodids, molatomid, molnames, molcomments})
  }) 
}

